Caption:
First we must become vulnerable. Vulnerable to ourselves and then we can be vulnerable to others. Becoming vulnerable to ourselves means being honest with ourselves. One of the hardest things to do! Especially when our ego will tell us otherwise. It can be hard to admit our wrongs as it brings in feelings of shame and guilt. But we can move through these by accepting that we were only acting out those hurtful behaviours because we were scared and didn’t know how to deal with our fear in a healthy way. Recovery teaches us forgiveness of others and ourselves, to find forgiveness we must find acceptance. This opens up the room for letting go and moving forward.

